import React from 'react';
import styles from './index.module.css';

function Star({color}) {
    let theme;
    switch (color) {
        case "GRAY":
            theme = styles.gray;
            break;
        case "YELLOW":
            theme = styles.yellow;
            break;    
    }
    return (
        <div className={theme}>
        <div className={styles.star}></div>
    </div>
    )
}

export default Star
